import { useEffect } from "react";
const AllUsers = () => {
  const [items, setItems] = useState([]);

  return (
    <div>
      <h1>All Users</h1>
      <ul>
        {items.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </div>
  );
};
